INSERT INTO `restaurants` VALUES ('86', '1300 on Fillmore', 'This spot in the heart of the Fillmore District serves up soulful American cuisine. Signature dishes include black skillet-fried organic chicken, shrimp and grits and maple syrup slow-braised short ribs. Don‚Äôt miss the Heritage Wall paying homage to the neighborhood‚Äôs legendary jazz history. Gospel Brunch on Sundays', '46', 'https://www.starbucks.com/coffeehouse/delivery', '', '0');
INSERT INTO `restaurants` VALUES ('92', '1760 Restaurant', 'Created by the family behind the acclaimed Acquerello, this spinoff highlights Italian and California-influenced dining in a sleek, casual atmosphere with Art Deco touches, expansive windows and a youthful slant. The service is polished, the atmosphere is lively and the presentation is beautiful', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('93', 'Ajanta', 'A changing menu of mostly organic, regional & seasonal Indian fare is paired with a local wine list.', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('94', 'Al\'s Place', 'Named America\'s best new restaurant of 2015 by Bon Appetit magazine, Al\'s Place is a casual, 46-seat restaurant located on an unassuming corner in the outskirts of the Mission District. Chef and owner Aaron London, a Sonoma native who\'s worked at acclaimed restaurants like Ubuntu, creates vegetable-focused and seafood main dishes, offering meat as a side', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('95', 'Alfred\'s Steakhouse', 'Hidden in an alley downtown, Alfred\'s has been a city institution since 1928. It embodies old-school elegance and serves prime cuts of Midwestern corn-fed beef and classic martinis', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('96', 'All Spice', 'Inventive Indian fusion cuisine served in a charming converted house with vivid teal walls', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('97', 'Alta CA', 'Wind down at this modern bar and restaurant, which offers specialty cocktails, a great hamburger and crunchy beef tendon puffs that melt in your mouth. The atmosphere is almost as good as the food, with a floor-to-ceiling industrial metal bookcase lining the back wall and local artwork.', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('98', 'Black Cat', 'Swanky jazz lounge, cocktail bar & New American bistro with two levels of seating & live music.', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('99', 'Boulevard', 'The Art Nouveau interior design and sweeping views of the bay draw tourists and locals alike to this upscale contemporary American restaurant. Splurge on a romantic date and taste the best of Northern California cuisine, from squash-blossom gnocchi to wood-oven-roasted Berkshire pork loin chop.', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('100', 'Boxing Room', 'Named for the space\'s former life as a room to box garments in the 19th-century Standard Shirt Factory, the Boxing Room is a welcoming spot to dine, drink and socialize before or after a performance at the opera, symphony or ballet. The chef, a Louisiana native, gives traditional Cajun and Creole dishes a California twist (the jambalaya features duck confit and brown rice). Brunch', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('101', 'Brasswood Bar and Kitchen', 'Oysters, pastas & sophisticated Californian dishes for dinner in a cozy, elegant space at a winery', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('102', 'Buckeye Roadhouse', 'It‚Äôs been quite a while since the Buckeye Roadhouse stopped being a dingy highway diner as the name might imply. Today, the Buckeye is a beautiful restaurant offering delicious traditional steaks alongside portabella mushroom lasagna and butternut squash. Exposed beams and a roaring fireplace make one feel as if they‚Äôre taking warm refuge from some place much wilder than Mill Valley', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('103', 'Bull Valley Roadhouse', 'Family-style American fare & pre-Prohibition cocktails served in circa-1897 digs with period decor', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('104', 'Cafe Eugene', 'Pacific Northwest‚Äìinfluenced New American fare & cocktails in cool quarters with eclectic accents', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('105', 'Campton Place', 'The Michelin Guide has awarded this polished hotel restaurant one star five years in a row and two stars for 2016. Indian-born chef Srijith Gopinathan\'s sophisticated contemporary California-Indian cuisine combines French classical cooking techniques with local, seasonal ingredients and global flavors. The signature Spice Route tasting menu changes frequently.¬†Brunch', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('106', 'Cassava', 'New American restaurant serving Californian cuisine, wine, beer & brunch in a cozy space', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('107', 'Central Kitchen', 'The creative minds behind the wildly popular Flour + Water restaurant left Italian food behind in this venture, instead focusing on Northern California cuisine. The succinct, frequently updated menu features simple, fresh preparations of locally sourced meats and seasonal produce. Dishes may include chilled tomato soup; seared squid with avocado, celery and pine nut mousse; and slow baked halibut with fried mussels, tomatoes and nasturtium. The airy, spacious dining room and patio exude rustic warmth', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('108', 'Epic Steak', 'The first new construction permitted on the San Francisco waterfront in more than a century, Epic occupies a grand,¬†soaring industrial space with unparalleled views. A steak or a burger is the way to go if you don\'t fill up early on the fantastic popovers and corn-bread madeleins. Ask for a table by the window for phenomenal waterfront views', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('109', 'Farmshop', 'Innovative eclectic plates & creative cocktails delivered in rustic-chic quarters with open kitchen', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('110', 'Mosu', 'Sophisticated Asian & New American tasting menu presented in an austere space with modern design', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('111', 'Parallel 37', 'Named for the geographic latitude running near the Bay Area, this restaurant, bar and lounge in the Ritz Carlton hotel atop Nob Hill serves elegantly simple, contemporary American cuisine, complemented by an exceptional mixology program and a stellar wine list. The sleek and modern interior brings an urban edge to the five-star hotel', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('112', 'The Keystone', 'Relaxed tavern in a modernized historic space for craft cocktails, bar bites & New American entrees', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('113', 'Valette', 'Rustic-chic wine-country eatery serves Californian cuisine & wine in an upscale space', '46', '', '', '0');
INSERT INTO `restaurants` VALUES ('114', 'A16', 'This Marina neighborhood hot spot combines the cuisine of Campania with the pizzas of Naples and pours small-production wines from California and Southern Italy', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('115', 'Aatxe', 'Located on the street level of the Swedish American Hall, this Basque restaurant (pronounced aah-CHAY) excelles in Spanish wines, ciders, beers and tapas from talented chef Ryan Pollnow', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('116', 'Belga', 'Belgian menus with German & California influences, plus lots of beer in a polished, casual setting.', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('117', 'Bistro Jeanty', 'In everyday French life, it‚Äôs said that a bistro is more than a restaurant‚Äîit‚Äôs a culture. In this cozy yet elegant space, dig into classic and hearty fare like cassoulet and coq au vin', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('118', 'Capo\'s', 'Speakeasy-like Italian restaurant & bar specializing in Chicago-style pies & handcrafted cocktails', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('119', 'Cotogna', 'This casual cousin to the acclaimed two Michelin star Quince restaurant next door opened under the same chef-owners. The rustic Italian eatery serves a seasonally changing menu that features spit-roasted meats and game birds, wood-oven pizzas, house-made pastas and fresh local seafood. All wine bottles on the prix fixe wine menu are under $40, and the floor-to-ceiling windows afford abundant natural light and dramatic views of the Transamerica Building.', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('120', 'Evvia', 'Destination for refined renderings of classic Greek dishes in lively surroundings', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('121', 'Fiorella', 'Chic, cozy bistro dishing up elevated Italian pastas & wood-fired pizzas, plus wine & craft beer', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('122', 'Flour + Water', 'Handcrafted Italian grub, including pasta & wood-fired pizza, served in a casual, rustic space', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('123', 'Jersey', 'Buzzy pizzeria boasting exposed brick & polished concrete floors, plus pasta, meat dishes & seafood', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('124', 'La Mar Cebicheria Peruana', 'The traditional Peruvian dishes at this attractive, modern space on the waterfront showcase fresh seafood with influences from China and Japan. Signature offerings include ceviches, causas, empanadas and anticuchos, as well classic and updated main courses. Pair them with a pisco sour cocktail', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('125', 'Oliveto Restaurant', 'Rotating menus contain locally sourced ingredients for handcrafted pastas & other regional fare', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('126', 'Pizzeria Delfina', 'These sister restaurants to famed Delfina in the Mission District serve eight Neapolitan, thin-crust pizzas and two rotating daily special pies, all inspired by a combination of styles from Naples and New York. Besides pizzas, the neighborhood hot spots also prepare antipasti filled', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('127', 'Plaj', 'These sister restaurants to famed Delfina in the Mission District serve eight Neapolitan, thin-crust pizzas and two rotating daily special pies, all inspired by a combination of styles from Naples and New York. Besides pizzas, the neighborhood hot spots also prepare antipasti filled with fresh-stretched mozzarella, ricotta cannoli and seasonal salads. California St.: L (W-M), D (nightly). 18th St.:¬†L (Tu-Su), D (nightly)', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('128', 'Trestle', 'New American restaurant offering 3-course prix fixe meals in a quaint space with modern flair.', '52', '', '', '0');
INSERT INTO `restaurants` VALUES ('129', 'Acquerello', 'This serene, urbane Cal-Med restaurant is housed in a former 1920s Mission-style chapel. Dishes like house-made pasta coated in a marsala cream sauce with shavings of black truffle are luxurious and elegant. The revered special-occasion spot (founded in 1989) is one of San Francisco\'s best any night of the week', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('130', 'Bar Crudo', 'A friendly neighborhood raw bar, Bar Crudo serves everything from a delicious selection of sashimi-style crudos to fantastic seafood chowder with potatoes and applewood-smoked bacon', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('131', 'Ijji', 'Tiny sushi bistro from a Tokyo standout with classic Japanese nigiri & drinks in modern quarters', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('132', 'Miminashi', 'Buzzy, stylish venue for contemporary izakaya-style Japanese cuisine & housemade ice cream', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('133', 'Morimoto', 'Food Network‚Äôs Iron Chef America‚Äôs star Masaharu Morimoto‚Äôs first West Coast restaurant showcases the renowned chef‚Äôs distinct culinary style, which seamlessly integrates Asian and Western ingredients with traditional Japanese techniques. Don‚Äôt miss the uni carbonara or the foie gras chawan mushi‚Äîand if you‚Äôre feeling adventurous, try the omakase menu', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('134', 'Okane', 'Modern cafe for handmade rolls, noodles & other Asian staples amid colorful, stylish decor', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('135', 'Omakase', 'Sleek sushi restaurant serves imported Japanese fish in several high-end chef\'s-choice dinner menus', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('137', 'Ozumo', 'This swanky space in SoMa and the East Bay is divided into two areas: a sake lounge with a full bar, and a dining room with a sushi bar and modern interpretations of traditional Japanese fare, including items from the robata grill. L (M-F), D (nightly).', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('138', 'Roka Akor', 'This 2014 Michelin star recommended restaurant features a seasonal menu with prime cuts of steak, seafoods and vegetables with Japanese-inspired marinades and sauces along with sushi, sashimi and tempura', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('139', 'Sushi Hon', 'Elevated bistro serving sushi, √† la carte Japanese classics & an omakase menu in modern environs.', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('140', 'The Perennial', 'Upscale New American bistro serving locally sourced, eco-friendly fare in industrial-chic quarters', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('141', 'The Slanted Door', 'Trendy Charles Phan eatery serving modern Vietnamese fare in a glass-heavy space with bay views', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('142', 'Yuzuki Japanese Eatery', 'The name of this understated yet welcoming Japanese¬†restaurant¬†that serves authentic cuisine in a serene setting in the Mission District means ‚Äúhealing moon.‚Äù Expect a meal with clean, subtle and elegant flavors from the former executive¬†chef¬†of some of Osaka‚Äôs top restaurants. You can‚Äôt go wrong with the silky, house-made tofu (made using labor-intensive traditional methods), king trumpet mushrooms with sesame sauce, elegant koshihikari rice in an earthen pot or ginger sorbet.', '53', '', '', '0');
INSERT INTO `restaurants` VALUES ('143', 'Cala', 'This upscale Mexican restaurant and cocktail bar is the latest success story from chef Gabriela Camara, who is known for several respected restaurants in Mexico, including MeroToro and Contramar. The seafood and vegetable-focused menu is unlike that of any Mexican restaurant in San Francisco', '54', '', '', '0');
INSERT INTO `restaurants` VALUES ('144', 'Calavera', 'Oaxacan fare, from ceviche to local seafood to seasoned grasshoppers, served in lofty, stylish digs', '54', '', '', '0');
INSERT INTO `restaurants` VALUES ('145', 'Foreign Cinema', 'Never was the old dinner-and-a-movie done so artfully, or so deliciously. The vast,¬†bohemian-chic space suits the always excellent California-Mediterranean cuisine. A heated, covered patio screens a rotation of classic, foreign and independent films projected onto one of three walls, and speakers on each table allow you to adjust the volume. Meandering through the¬†changing exhibits¬†in the adjacent gallery is the perfect way to wait for a table.', '55', '', '', '0');
INSERT INTO `restaurants` VALUES ('146', 'Jannah', 'Middle Eastern restaurant providing Iraqi-Californian dishes in a relaxed, warmly decorated venue.', '55', '', '', '0');
INSERT INTO `restaurants` VALUES ('147', 'Kitchen Istanbul', 'Kebabs & other Turkish-Mediterranean dishes served in a warm restaurant setting with a bar.', '55', '', '', '0');
INSERT INTO `restaurants` VALUES ('148', 'Kokkari Estiatorio', 'Taverna-inspired cuisine served in a candlelit, wood-beamed dining room that lures a chic crowd', '55', '', '', '0');
INSERT INTO `restaurants` VALUES ('149', 'Coi', 'This two Michelin star restaurant from visionary chef Daniel Patterson has a gorgeous, Zen-like dining room and creates exquisite, vegetable focused dishes. It made headlines when it switched from traditional reservations to a ticketing system in 2014', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('150', 'Commonwealth', 'Named after the concept of organizing for the common good, you can feel good about dining here‚Äîand not just because of the harmoniously layered, delectable dishes. This progressive eatery donates $10 from each tasting menu to local nonprofits', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('151', 'Contigo', 'Changing nightly, the menu at this beloved California-style tapas spot in Noe Valley highlights the Bay Area\'s farmers, ranchers, fishermen and artisans. The sleek design and friendly service make for a festive evening. Pick a glass of sparkling Cava or Rioja from the all-Spanish wine list and stay for the chocolate and churros dessert', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('152', 'Corridor Restaurant', 'This counter service-style restaurant from the Hi Neighbor Restaurant Group (Stones Throw, Trestle) serves up soups, salads, pastas and shareable dishes including crispy falafel croquettes and spicy meatballs. The adjacent Corridor Cafe offers a variety of coffee drinks, sandwiches and breakfast options.', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('153', 'Dosa', 'With locations in the Mission and Fillmore districts, this trendy restaurant offers many incarnations of its namesake southern Indian delicacy. A selection of savory appetizers and curries round out the menu. Fillmore St', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('154', 'Farallon', 'This classic Pat Kuleto restaurant in¬†Union Square¬†has been enchanting guests for 18 years with carefully crafted details that capture the life aquatic. Blending casual and high-end coastal cuisine, Farallon offers fresh seafood options and simple raw preparations from the oyster bar. Beyond the welcoming spot\'s dinner menu, find an approachable wine list, one of the largest collections of single malt whiskeys in the city and inventive desserts', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('155', 'Hog & Rocks', 'San Francisco\'s first ham and oyster bar landed on the SF Chronicle\'s top 100 Bay Area Restaurants 2013 list. The casual gastropub is just as perfect a destination for cocktails and bar bites as it is for a full meal, with popular options like the ham tasting plate, deviled eggs and fish and chips', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('156', 'Leo‚Äôs Oyster Bar', 'This upscale seafood restaurant is the latest establishment from Anna Weinberg and James Nicholas (Marlowe, Park Tavern, The Cavalier), who describe the place as having a ‚Äúbreezy, slightly tropical \'50s feel.‚Äù The retro interior was inspired by the TV show \"Mad Men\" and features a long brass and onyx bar complete with an oyster station as well as an atrium outfitted with ferns and other plants. Menu highlights include more than a half dozen varieties of oysters along with crab, shrimp, lobster Louie and lobster rolls', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('157', 'Montesacro', 'Industrial-chic enoteca for Roman-style pizza (called \"pinsa\") from a brick oven, plus wine & beer.', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('158', 'Mourad', 'Soaring ceilings, spherical chandeliers and polished furnishings‚Äîthis Moroccan restaurant is nothing if not swanky. From the acclaimed chef behind the longstanding Michelin-starred Aziza in the Outer Richmond District, this is a more modern and glamorous counterpart to the local favorite. It offers an impressive tasting menu as well as traditional, family-style dishes such as roast chicken prepared with exacting technique and presented with comforting sides and sauces. Start with one of the outstanding starters like asparagus with crispy quinoa, basteeya (duck confit wrapped in phyllo) or eggplant prepared three ways and served with warm, thick flatbread rounds', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('159', 'Nico', 'This gorgeous, intimate bistro from a husband and wife team features a market-driven, nightly-changing menu of French and California influences with options including oyster and goat cheese beignets, halibut served with fennel and summer squash and a long list of wine pairings', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('160', 'Nightbird', 'Highbrow Californian tasting menu from an upscale bistro with an adjacent cocktail lounge', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('161', 'Old Bus Tavern', 'Located in Bernal Heights, this casual restaurant offers¬†house-brewed American and Belgian-style ales along with¬†11¬†guest drafts¬†sourced within a 50-mile radius. The menu skews toward the comforting and American‚Äîthere‚Äôs an extra-spicy chili and a must-order buckwheat cornbread. Be sure listen for the daily-changing playlist on vinyl', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('162', 'Olea', 'This intimate, romantic neighborhood restaurant on the cable car line features a weekly-changing menu with a seasonal focus and dishes made with fresh organic produce, Niman Ranch meats and sustainable, wild-caught seafood. Locals line up for the weekend brunch featuring challah French toast and a cazuela baked egg dish. Dinner brings pappardelle pasta with lamb meatballs and pan-seared duck breast with German butterball potatoes, delicata squash and sauteed broccolini.', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('163', 'Piqueo\'s', 'With an artful ambiance, this Fusion Peruvian restaurant offers distinct regional Peruvian flavors and spices that explode through its cuisine.', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('164', 'RN74', 'Designed to mirror the rustic road that runs through Burgundy, this spot serves nearly 3,000 wines and a menu featuring Michael Mina creations such as glazed duck confit and olive oil poached halibut. L (M-F), D (nightly).', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('165', 'Redd', 'Upscale Californian fare in a sleek, contemporary space with outdoor seating & wine country views.', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('166', 'Rich Table', 'Named one of the country\'s top 50 new restaurants by Bon Appetit magazine in 2012, this James Beard Award-nominated hot spot is owned by a husband-and-wife team who serve unfussy, market-driven food in a lively atmosphere. Must-order items include innovative snacks like sardine chips and porcini doughnuts and creative cocktails. D (daily).', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('167', 'SHED Cafe', 'Local food-focused outfit hosting a market, cafe & fermentation bar in a modern setting with events', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('168', 'Sons & Daughters', 'The brainchild of two young chefs, this restaurant on the cable car line brings contemporary fine dining to Union Square. An open kitchen is centered in the middle of the sleek dining room, turning out inventive dishes like sweetbreads with lobster claw, lavender pork belly and scallop with mushrooms and veal tea. D (W-Su).', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('169', 'Spruce', 'A gathering place for posh Pacific Heights residents, this successful spot will make any visitor feel like a glamorous local. The menu is wide-ranging, and the setting is chic and masculine. Brunch (Su), L (M-F), D (nightly).', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('170', 'SPQR', 'Italian entrees & tasting menus made with local ingredients & a vast wine list served in cozy digs', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('171', 'Stones Throw', 'This inviting casual-chic spot has one of the city\'s most talented restaurant teams (including three Michael Mina alums). The seasonal menus here are outstanding‚Äîorder the perfectly grilled, melt-in-your mouth octopus and the puffed potato and eggs if they\'re in the lineup. The artfully presented desserts are playful riffs on childhood classics, like peanut butter and jelly doughnuts. Neighborhood foodies rave about the Sunday brunch.', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('172', 'Terzo', 'This warm restaurant has the friendly feeling of a place where the servers greet many patrons by name. Chef Mark Gordon‚Äôs menu of great small plates includes unexpected combinations such as fennel with chopped egg and olives. Angle for a spot near the fireplace and make yourself at home. D (nightly).', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('173', 'Waterbar', 'This waterfront restaurant offers views of the bay and Treasure Island along with seafood fresh from the Pacific Ocean, including pristine raw bar selections and fire-roasted whole lobster. L, D daily.', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('174', 'Wayfare Tavern', 'Step inside celebrity chef Tyler Florence‚Äôs handsome three-story restaurant and be transported back in time. Built with bricks salvaged from the streets of the devastated city after the 1906 quake, the eatery channels the Barbary Coast era with American fare inspired by the San Francisco restaurant scene of the late 1800s. The menu features a raw bar and dishes like grilled sardines, salt-roasted bone marrow, organic fried chicken and the classic Hangtown Fry. Don‚Äôt miss the banana pudding for dessert and the hand-crafted cocktails. L, D (daily).', '56', '', '', '0');
INSERT INTO `restaurants` VALUES ('175', 'Wise Sons Jewish Delicatessen', 'Traditional Jewish deli offerings like pastrami & corned beef made in-house with local ingredients', '56', '', '', '0');
